import React, { Component } from 'react';
import Notifcation from "./Notification";
import Collect from './Collect';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link,
    withRouter,
    Redirect
} from "react-router-dom";
import { BrowserRouter } from 'react-router-dom';

class Blog extends Component {
    render() {
        return (
          <div className="App">
            <BrowserRouter>
              <Switch>
                <Route path="/notification" component={Notifcation} />
                <Route path="/collect" component={Collect} />
                <Redirect from="*" to="/" />
              </Switch>
            </BrowserRouter>
            <nav>
              <ul>
                <Link to="/notification">Notifcation</Link>
                {/* <Router>
                  <Route path="/notification" exact component={Notifcation} />
                </Router> */}
              </ul>
              <ul>
                <Link to="/collect">Form-Table</Link>
                {/* <Router>
                  <Route path="/collect" exact component={Collect} />
                </Router> */}
              </ul>
            </nav>
          </div>
        );
    }
}
export default withRouter(Blog) ;
